<!DOCTYPE html>
<html lang="en">

<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <title>Document</title>
    <link rel="stylesheet" href="styles.css">


    <script src="https://cdn.jsdelivr.net/npm/rebound@0.1.0/dist/rebound.min.js"></script>
    
    <script src="https://connect.soundcloud.com/sdk/sdk-3.0.0.js"></script>
    <script src="player.js"></script>


</head>

<body>

    <div class="player-extended">
        <div class="bgBox">
            <img src="assets/img/cover-02.jpg" class="polyrize" />
        </div>
        <h1><span>Muse</span></h1>
    </div>
    <section class="main">
        <div id="player">
            <section class="player">
                <div class="menu-button"><span></span></div>
                <section class="playlist">
                    <ul>
                        <li class="track" data-album="the 2nd Law" data-trackid="65852671">
                            <div>
                                <figure>
                                    <img src="data:image/jpeg;base64," />
                                </figure>
                                <label>
                                    <strong>MUSE</strong>
                                    <span>Madness</span>
                                    <time>02:31</time>
                                </label>
                            </div>
                        </li>
                        <li class="track" data-album="til the casket drops" data-trackid="63539496">
                            <div>
                                <figure>
                                    <img src="data:image/jpeg;base64," />
                                </figure>
                                <label>
                                    <strong>ZZ Ward</strong>
                                    <span>Move Like You Stole It</span>
                                    <time>03:19</time>
                                </label>
                            </div>
                        </li>
                        <li class="track" data-album="Lights out" data-trackid="169091389">
                            <div>
                                <figure>
                                    <img src="data:image/jpeg;base64," />
                                </figure>
                                <label>
                                    <strong>Ingrid Michaelson</strong>
                                    <span>Girls Chase Boys</span>
                                    <time>03:16</time>
                                </label>
                            </div>
                        </li>
                    </ul>
                    <p class="info">Day 005 of Paul Flavius Nechita 100 Days of UI challenge.
                        Created as a minimal soundcloud player. Playing around with canvas to extract
                        cover colors, and creating the background effect, viewport units and audio
                        to bring this to live.
                    </p>

                </section>

                <figure class="currentTrack">
                    <div class="currentTrackCover"></div>
                    <img src="data:image/jpeg;base64," />
                    <figcaption>Muse<br>The 2nd Law</figcaption>
                </figure>
                <section class="controls">
                    <h2 class="title">Madness</h2>
                    <div class="audio">
                        <div class="play-pause">
                            <p class="play"><i class="fa fa-play"></i></p>
                            <p class="pause"><i class="fa fa-pause"></i></p>
                        </div>
                        <div class="scrubber">
                            <div class="progress"></div>
                            <div class="loaded"></div>
                        </div>
                        <div class="time">
                            <em class="played">00:00</em>
                            <strong class="duration">02:31</strong>
                        </div>
                    </div>
                    <div class="buttons">
                        <div class="repeat"><i class="fa fa-refresh"></i></div>
                        <div class="shuffle"><i class="fa fa-random"></i></div>
                    </div>
                </section>
            </section>
        </div>
    </section>


</body>

</html>